    public List<Integer> findAnagrams2(String s, String p) {
        int sLength = s.length();
        int pLength = p.length();
        List<Integer> ans = new ArrayList<>();
        int i = 0;
        while (i + pLength - 1 < sLength){
            String q = s.substring(i, i+pLength);
            int BitNum = CommonBits(q,p);
            System.out.println(BitNum);
            if (BitNum == pLength){
                ans.add(i);
                i++;
            }else {
                i += pLength - BitNum;
            }
        }
        return ans;
    }

    public int CommonBits(String q, String p){
        // 返回从后往前数，匹配的位数。q和p是位数相同的两个字符串
        Map<Character, Integer> Pchar = new HashMap<>();
        for (int i = 0; i < p.length(); i++) {
            if (!Pchar.containsKey(p.charAt(i))){
                Pchar.put(p.charAt(i), 1);
            }else {
                Pchar.put(p.charAt(i), Pchar.get(p.charAt(i))+1);
            }
        }
        int ans = 0;
        for (int i = q.length()-1; i > -1; i--) {
            if (Pchar.containsKey(q.charAt(i))){
                if (Pchar.get(q.charAt(i)) == 1){
                    Pchar.remove(q.charAt(i));
                }else {
                    Pchar.put(q.charAt(i), Pchar.get(q.charAt(i))-1);
                }
                ans++;
            }else {
                // 如果该位字符串不符合，提前终止
                return ans;
            }
        }
        return ans;
    }

    public List<Integer> findAnagrams(String s, String p) {
        if (s.length() < p.length()){
            return null;
        }
        int[] Schar = new int[26];
        int[] Pchar = new int[26];
        for (int i = 0; i < 26; i++) {
            Schar[i] = 0;
            Pchar[i] = 0;
        }
        for (int i = 0; i < p.length(); i++) {
            Pchar[p.charAt(i)-'a']++;
            Schar[s.charAt(i)-'a']++;
        }
        List<Integer> Anagrams = new ArrayList<>();
        if (Arrays.equals(Schar, Pchar)){
            Anagrams.add(0);
        }
        for (int i = 1; i + p.length() - 1 < s.length(); i++) {
            Schar[s.charAt(i+p.length()-1)-'a']++;
            Schar[s.charAt(i-1)-'a']--;
            if (Arrays.equals(Schar, Pchar)){
                Anagrams.add(i);
            }
        }
        return Anagrams;
    }

